INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 7, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 7, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 10, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 10, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 12, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -470.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 25, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 25, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 25, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 25, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 18, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 18, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 2, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 19, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 3, 0, "2015/12/17 15:00:00", 0, -470.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 19, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 4, 0, "2015/12/17 15:00:00", 0, -470.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 20, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 5, 0, "2015/12/17 15:00:00", 0, -470.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 20, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 6, 0, "2015/12/17 15:00:00", 0, -470.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 21, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 21, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 21, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 21, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 22, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -430.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 22, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 2, 0, "2015/12/17 15:00:00", 0, -430.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 23, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 3, 0, "2015/12/17 15:00:00", 0, -430.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 23, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 4, 0, "2015/12/17 15:00:00", 0, -430.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001, 109001, "2030/12/17 14:59:59", 4.08, "エリコ（バレンタイン）", 1, 8.0, 1, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002, 109001, "2030/12/17 14:59:59", 5.0, "エリコ（バレンタイン）", 1, 8.0, 2, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, 109001, "2030/12/17 14:59:59", 10.11, "エリコ（バレンタイン）", 1, 8.0, 3, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004, 109001, "2030/12/17 14:59:59", 4.0, "エリコ（バレンタイン）", 1, 8.0, 4, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005, 109001, "2030/12/17 14:59:59", 6.0, "エリコ（バレンタイン）", 1, 8.0, 5, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, 109002, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 1, 0.0, 6, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, 109002, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 1, 0.0, 7, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, 109002, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 1, 0.0, 8, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009, 109002, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 1, 0.0, 9, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010, 109002, "2030/12/17 14:59:59", 0.0, "エリコ（バレンタイン）", 1, 0.0, 10, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011, 109101, "2030/12/17 14:59:59", 2.12, "シズル（バレンタイン）", 1, 8.0, 1, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012, 109101, "2030/12/17 14:59:59", 4.19, "シズル（バレンタイン）", 5, 8.0, 2, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4, 24, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013, 109101, "2030/12/17 14:59:59", 2.3, "シズル（バレンタイン）", 2, 8.0, 3, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014, 109102, "2030/12/17 14:59:59", 0.0, "シズル（バレンタイン）", 1, 0.0, 4, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015, 109101, "2030/12/17 14:59:59", 5.23, "シズル（バレンタイン）", 5, 8.0, 5, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016, 109102, "2030/12/17 14:59:59", 0.0, "シズル（バレンタイン）", 1, 0.0, 6, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 24, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017, 109101, "2030/12/17 14:59:59", 5.01, "シズル（バレンタイン）", 1, 8.0, 7, 10011, "2019/01/31 12:00:00", 0, -385.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018, 109102, "2030/12/17 14:59:59", 0.0, "シズル（バレンタイン）", 1, 0.0, 8, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019, 109102, "2030/12/17 14:59:59", 0.0, "シズル（バレンタイン）", 1, 0.0, 9, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 24, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020, 109102, "2030/12/17 14:59:59", 0.0, "シズル（バレンタイン）", 1, 0.0, 10, 10011, "2019/01/31 12:00:00", 0, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 26, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26001, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 26, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26002, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 26, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26003, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 26, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26004, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 27, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27001, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27002, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 27, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27003, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 27, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 27004, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 28, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 1, 0, "2019/09/24 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 28, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 28002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 2, 0, "2019/09/24 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 29, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 29001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 3, 0, "2019/09/24 15:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 29, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 29002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 4, 0, "2019/09/24 15:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 30, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 30001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 5, 0, "2019/09/24 15:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 30, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 30002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 6, 0, "2019/09/24 15:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 31, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 31001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 7, 0, "2019/10/31 12:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 31, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 31002, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 8, 0, "2019/10/31 12:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 32, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 32001, 190801, "2020/01/04 4:59:59", 0.0, "カリン", 1, 0.0, 1, 0, "2019/12/20 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 32, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 32002, 190801, "2020/01/04 4:59:59", 0.0, "カリン", 1, 0.0, 2, 0, "2019/12/20 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 33, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 33001, 190801, "2020/01/04 4:59:59", 0.0, "カリン", 1, 0.0, 3, 0, "2019/12/20 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 33, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33002, 190801, "2020/01/04 4:59:59", 0.0, "カリン", 1, 0.0, 4, 0, "2019/12/20 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 34, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 34001, 190801, "2020/01/10 11:59:59", 0.0, "カリン", 1, 0.0, 5, 0, "2020/01/04 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 34, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 34002, 190801, "2020/01/10 11:59:59", 0.0, "カリン", 1, 0.0, 6, 0, "2020/01/04 5:00:00", 0, -409.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 38, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 38001, 105801, "2030/12/17 14:59:59", 5.3, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -458.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 38, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 38002, 105801, "2030/12/17 14:59:59", 6.5, "ペコリーヌ", 1, 0.0, 2, 0, "2015/12/17 15:00:00", 0, -458.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (3, 39, "", 39005, 105801, "2020/04/08 23:59:59", 0.0, "ペコリーヌ", 3, 9999.0, 0, 0, "2020/04/01", 0, 9999.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 40, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 40001, 190801, "2030/12/17 14:59:59", 0.0, "カリン", 1, 0.0, 2, 0, "2015/12/17 15:00:00", 0, -430.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 41, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41001, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 41, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41002, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 41, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41003, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 41, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41004, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 42, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 42, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002, 106401, "2030/12/17 14:59:59", 0.0, "シェフィ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 2104010, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 42, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 42, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 43, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001, 105801, "2030/12/17 14:59:59", 0.0, "ペコリーヌ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 43, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, 105901, "2030/12/17 14:59:59", 0.0, "コッコロ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 43, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003, 106001, "2030/12/17 14:59:59", 0.0, "キャル", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -363.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 44, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004, 123001, "2030/12/17 14:59:59", 0.0, "アメス", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 44, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005, 123001, "2030/12/17 14:59:59", 0.0, "アメス", 1, 0.0, 2, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 45, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006, 123001, "2030/12/17 14:59:59", 5.79, "アメス", 1, 0.0, 3, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (1, 46, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001, 123001, "2030/12/17 14:59:59", 0.0, "アメス", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -371.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 47, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001, 104901, "2030/12/17 14:59:59", 0.0, "シズル", 2, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2, 47, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 47002, 101101, "2030/12/17 14:59:59", 9.32, "リノ", 1, 0.0, 1, 0, "2015/12/17 15:00:00", 0, -416.5);
